import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component '" + name + "' was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1>{`Book Notes`}</h1>
    <p>{`This is my booknotes blog where I share notes on books I am reading and podcasts I am listening to.`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/johnbetts"
        }}>{`Jung's Model of the Psyche from Jungian Analyst John Betts.`}</a></li>
      <li parentName="ul">{`Sapiens by Yuval Noah Harari  `}</li>
      <li parentName="ul">{`The Racial Complex: A Jungian Perspective on Culture and Race by Fanny Brewster`}</li>
      <li parentName="ul">{`The Origins and History of Consciousness by Erich Neuman`}</li>
      <li parentName="ul">{`ENEMIES: From War to Wisdom podcast`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
